import React, { Component } from 'react';
import { Modal } from 'antd';
class CModal extends Component {
	state = {
		visible: true,
	};
	hideModel = () => {
		this.setState({ visible: !this.state.visible });
	};
	render() {
		return (
			<div>
				<Modal
					onOk={this.hideModel}
					destroyOnClose={true}
					show={this.state.visible}
				>
					<a>Exam is not available</a>
				</Modal>
			</div>
		);
	}
}

export default CModal;
